import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import { Link } from "react-router-dom";

import MainNavbar from '../MainNavbar.js';

import card1 from '../../images/events/singapore-allergy-and-rhinology-conference-2018/image1.jpg';

function Events() {


    const events = [
        {
            id:1, 
            name:"EcZeCare Ceramide Cream", 
            image: card1,
        },
        {
            id:2, 
            name:"EcZeCare Ceramide Intensive Cream", 
            image: card1,
        },
        {
            id:3, 
            name:"EcZeCare Ceramide Rapid Itch Relief Cream", 
            image: card1,
        },
        {
            id:4, 
            name:"EcZeCare Dry Skin Treatment", 
            image: card1,
        },
        {
            id:5, 
            name:"EcZeCare Oatmeal range", 
            image: card1,
        },
        {
            id:6, 
            name:"Elidel Cream", 
            image: card1,
        },
    ];

    const eventList = events.map((event) =>(

        <div key={event.id}>
            <Col>
                <Link to="/">
                    <div className="card mb-3 hoverable">
                        <div className="row no-gutters">
                            <div className="col-md-4">
                            <img src={event.image} className="card-img" alt="..."/>
                            </div>
                            <div className="col-md-8">
                                <div className="card-body">
                                    <h5 className="card-title">{event.name}</h5>
                                </div>
                            </div>
                        </div>
                    </div>
                </Link>
            </Col>
        </div>

    ));

    return(
        <>
            <MainNavbar activeTab="/events"/>
            <div className="container section events">
                <div className="row">
                    <div className="col side-title">
                        <h3>Events</h3>
                        <hr/>
                    </div>
                </div>


                <div className="row upcoming-events">
                    <div className="col">
                    <h5>Upcoming events</h5>
                        <Row xs={1} md={2} className="g-4">
                            {Array.from({ length: 2 }).map((_, idx) => (
                                <Col key={idx}>
                                <Card className="event-card">
                                    <Card.Img variant="top" src={card1} />
                                    <Card.Body>
                                    <Card.Title>CME Talk for Doctors: The Sporting Knee</Card.Title>
                                    <Card.Text>
                                        This is a longer card with supporting text below as a natural
                                        lead-in to additional content. This content is a little bit
                                        longer.
                                    </Card.Text>
                                    </Card.Body>
                                </Card>
                                </Col>
                            ))}
                        </Row>
                    </div>
                </div>
                


                <div className="row past-events">
                    <div className="col">
                        <h5>Past events</h5>
                        <Row xs={1} md={2} className="g-4">
                            {eventList}
                        </Row>
                    </div>
                </div>






            </div>
        </>
    );
}

export default Events;
